import { useEffect } from "react";
import { useParams } from "react-router"

const SingleBuilding = () => {
  const buildingId = useParams()

  useEffect(() => {
    console.log(buildingId)
  }, []);


  return(
    <>
      <h1>SingleBuilding</h1>
    </>
  )
}

export default SingleBuilding
